// @ts-nocheck
import React from 'react';
import { Container, Typography, Grid, Button, Card, CardActionArea,CardContent,CardActions   } from '@material-ui/core';
import CardMedia from '@material-ui/core/CardMedia';

import useStyles from './styles';

type HeroProps = {
  background?: React.ReactNode;
};

const Hero: React.SFC<HeroProps> = ({ children, background = null }) => {
  const classes = useStyles();

  return (
    <div>
      <section className={classes.hero}>
      <Card className={classes.root}>
      <CardActionArea>
        <CardMedia
          className={classes.media}
          image="./hero.jpg"
          title="Contemplative Reptile"
        />
      </CardActionArea>

    </Card>
        <div className={classes.heroContainer} >
            <div className={classes.heroContent}>
                <h1>Unsplash</h1>
                <p>
                The internetâ€™s source of freely useable images.
                Powered by creators everywhere.
                </p>
                <div className={classes.heroSearchForm} >
                <form>
                    <input type="text" placeholder="Search free high-resolution photos"/>
                </form>
                </div>
                <div className={classes.trendingSearchTags}  class="trending-search-tags">
                <p>Trending searches: <a href="#">flower</a>, <a href="#">wallpaper</a>, <a href="#">sad</a>, <a href="#">love</a></p>
                </div>
            </div>
            </div>
            <div className={classes.heroOverlay}  class="hero-overlay"></div>
        </section>

        <section className={classes.images} class="images">
            <div id="gallery">

            </div>
        </section>
    </div>
  );
};

export default Hero;
